import Container from "react-bootstrap/Container";
import Footer from "../components/Footer";
import HeaderIT from "../components/HeaderIT";

function ContattiIT() {
    return (
        <>
            <HeaderIT />
            <section id='contatti'>
                <Container>
                    <h2>Contatti</h2>
                </Container>
            </section>
            <Footer />
        </>
    );
}

export default ContattiIT;
